const Service = require('node-windows').Service;

const svc = new Service({
	name: 'unblock-netease-cloud-music',
	description: '点亮网易云音乐灰色歌曲',
	script: './app.js', // 入口文件路径
	// scriptOptions:'-p 52100:52101', // 可选参数示例: 自定义端口并开启HTTPS
	// scriptOptions: '-o qq', // 可选参数
	wait: '1', // 程序崩溃后重启时间间隔
	grow: '0.25', // 重启等待时间成长值，第一次1秒，第二次1.25秒。。。
	maxRestarts: '40', // 60秒内最大重启次数
	env: [
		// {
		// 	name: 'ENABLE_FLAC',
		// 	value 'true',
		// },
		// {
		// 	name: 'QQ_COOKIE',
		// 	value: 'uin=<your_uin>; qm_keyst=<your_qm_keyst>',
		// },
	],
});

// 监听
svc.on('install', () => {
	svc.start();
	console.log('Installation completed.');
});
svc.on('uninstall', () => console.log('Uninstallation completed.'));

// 卸载
if (svc.exists) return svc.uninstall();

// 安装
svc.install();

{
	"name": "@unblockneteasemusic/server",
	"version": "0.27.8-patch.1",
	"description": "Revive unavailable songs for Netease Cloud Music",
	"main": "src/provider/match.js",
	"bin": {
		"unblockneteasemusic": "./precompiled/app.js"
	},
	"engines": {
		"node": ">= 12"
	},
	"scripts": {
		"start:dev": "cross-env LOG_LEVEL=debug node src/app.js -e https://music.163.com",
		"start": "cross-env node src/app.js -e https://music.163.com",
		"build": "webpack",
		"pkg": "pkg . --out-path=dist/",
		"test": "jest"
	},
	"pkg": {
		"assets": [
			"server.key",
			"server.crt"
		],
		"targets": [
			"node18-linux-arm64",
			"node18-win-arm64",
			"node18-linux-x64",
			"node18-win-x64"
		],
		"outputPath": "dist"
	},
	"repository": {
		"type": "git",
		"url": "https://github.com/UnblockNeteaseMusic/server.git"
	},
	"author": "nondanee, 1715173329, pan93412",
	"license": "LGPL-3.0-only",
	"dependencies": {
		"node-windows": "^1.0.0-beta.8",
		"pino": "6.14.0",
		"pino-pretty": "^7.6.1"
	},
	"devDependencies": {
		"@swc/core": "^1.10.1",
		"@types/node": "^22.10.2",
		"@types/pino": "6.3.12",
		"@yarnpkg/sdks": "^3.2.0",
		"browserslist": "^4.24.3",
		"core-js": "^3.39.0",
		"cross-env": "^7.0.3",
		"jest": "^29.7.0",
		"pkg": "^5.8.1",
		"prettier": "^3.4.2",
		"swc-loader": "^0.2.6",
		"terser-webpack-plugin": "^5.3.11",
		"typescript": "^5.7.2",
		"webpack": "^5.97.1",
		"webpack-cli": "^5.1.4"
	},
	"resolutions": {
		"cacheable-request": "^10.2.9",
		"minimatch": "^3.0.8",
		"minimist": "^1.2.8",
		"semver": "^7.5.4"
	},
	"publishConfig": {
		"access": "public"
	},
	"packageManager": "yarn@3.8.5"
}

const TerserPlugin = require('terser-webpack-plugin');
const webpack = require('webpack');

module.exports = {
	target: 'node',
	mode: 'production',
	entry: {
		app: './src/app.js',
		bridge: './src/bridge.js',
	},
	output: {
		filename: '[name].js',
		path: __dirname + '/precompiled',
	},
	module: {
		rules: [
			{
				test: /\.m?js$/,
				exclude: /(node_modules|bower_components)/,
				use: {
					// Use `.swcrc` to configure swc
					loader: require.resolve('swc-loader'),
				},
			},
		],
	},
	plugins: [
		new webpack.BannerPlugin({
			banner: '#!/usr/bin/env node',
			raw: true,
		}),
	],
	optimization: {
		minimize: true,
		minimizer: [
			new TerserPlugin({
				parallel: true,
				minify: TerserPlugin.swcMinify,
				terserOptions: {
					compress: {
						ecma: 2018,
					},
					// https://swc.rs/docs/configuration/minification#jscminifycompress
				},
